import { cardData } from "../utils/mockData";
import {Card,QuoteIcon,Container,Image,CarousalContainer} from './styles';
import { Carousel } from 'react-responsive-carousel';

const ClientSlide=() =>{
return (
    <Carousel autoPlay>
    <Container>
        {cardData.map((card,index) =>
        <Container>
              <Card key={index}>
             <Image src={card.Image} alt="card"/>
             <QuoteIcon src={card.quoteIcon} alt="Icon"/>
             <p>{card.para}</p>
             <h1>{card.name}</h1>
             <h3>{card.title}</h3>
             </Card>
             </Container>
            )
        }      
</Container>
</Carousel>
)
}
export default ClientSlide;
